import { useState } from "react";
import Header from "../components/Header";

function About() {
  return (

    <div>

      <Header />

      <p className="p1">♡ The Weather Channel of Lala-Land is an American free television channel owned by
        Lala-Land Group ♡ The channel's headquarter is in Orange County, New York ♡ </p>

    </div>

  );
}
export default About;
